    "reviewContent": "Your hypothesis is that the economy is affected no matter who holds majority power? Ok., just looking at Republican gov. Since there is no comparison to Democrat govs, then you are attempting to show that Republican govs influence the economy. That's like saying that they influence the weather patterns. The economy exists and changes with or without govs. You'd have to show that the economy flounders without govs to show causation.  Also, you'd have to consider legislation passed during their gov's term and before and after the term. Also, does a Republican gov receive credit for a robust economy based on legislation passed by a prior Democratic gov?",
