    "id": 301,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "I wonder about your data on a number of levels. First, the economy shifts on a level that does not directly correspond to the actions of the governor. Did you also account for legislatures that are predominantly Republican or Democrat? Did you account for laws and procedures put into place by past governors? Did you account for the federal government's affect on the economy? Did you account for world/major events that occurred? The correlations seem too simplistic. Did you also account for the governors who are neither Republican nor Democrat? Apart from that, you have a few grammatical mistakes that should be corrected before publication. Also, some of your explanations are not fully rendered. For example: you state the scale you made and will use, but don't state if the scale is over the entire data set or based month to month.",
    "reviewRating": 4,
