    "id": 114,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "Firstly, it seems worth noting that the GDP actually goes down when there are more Republican governors, and the stocks stay flat. Only inflation and employment go up. Secondly, correlation does not equal causation. I appreciate that you're not proposing any particular cause, just that the two are connected, but it seems like you should really adjust for a number of other obvious variables. For example, you only bother with governors. Why not add presidents, senators, etc. to the data? This seems especially worthwhile given that a lot of people tend to vote one way locally and another nationally, either because their local parties are aligned somewhat differently on the issues or in the interest of \"balancing\" power by making sure neither party has too much at one time. If this causes a majority of Republican governors to tend to coincide with Democratic presidents, then, that would call into question who is actually responsible for the upward trend. Other factors to adjust for would be obvious economic booms (e.g. caused by the discovery of new resources or new ways to exploit them and therefore definitely not caused by politicians) busts (disasters, etc. that might harm the economy and similarly be outside political control) and any delay governmental procedure might cause in the actual enactment of laws (e.g. one governor might change policies during his term, but they only come to fruition under the next governor, from the opposing party).",
    "reviewRating": 6,
    "offsetValues": "[false,false,false,false]",
