    "id": 304,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "The conclusion that is being drawn is valid for the factors you are measuring. However, in my opinion your factors do not realistically show how well a governor is performing in terms of the economy just due to Republican or Democratic affiliation. For example, here in modern times you have to look at which party is in control of your congress and house representatives. As we all know both parties basically fight each other and thus the grid lock of the current state of government. So by just looking at some numbers and coming up with a grand stand point that Republican governors do better in terms of economics is missing too many other factors. I do think some of the data is a good staring point but you need to consider more and more factors.  ",
