    "id": 368,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "My mone major critique is that considering just how many factors influence each economic statistic here, it's an extremely bold claim that the current state of the government officials is the one that caused positive economic events. This also assumes that the decisions of current officials is what caused the economy to be doing well during their time as governor, which is an extremely common debate as may political actions can take years to show their affect on the economy.\n\nOther factors I'd also like to see noted are whether there were wars going on, the president's political identity during those years, and maybe a tally of the number of rejected bills that year by the Senate.",
