    "reviewContent": "This paper appears to be clearly written, and (with the exception of at least one minor grammatical error \"This allows us merge\") reads clearly. It would be preferable to have source materials cited when the author states that \"Governor data is collected\" and \"We collect . . . data\". As I'm not certain where this data is coming from, I am more hesitant to accept its validity than if I was aware of its provenance. While the author(s) do provide a table detailing all of this data, they then move very quickly to deciding that the Employment data will be the one factor that they use to determine economic performance. This decision could be fleshed out more clearly; why is that data the most representative? Why were the other factors dismissed? In fact, when looking at the other factors individual in the graph, different conclusions could be drawn entirely, as lines are near flat, sloping in the other direction, and at best inconsistent. I'm reluctant to accept the conclusions of this article based on the limited explanation of why the data piece Employment was paramount, and given that similar analysis of other single data elements yields different conclusions.",
