    "reviewContent": "The authors do not make a causal claim, but this correlation seems to omitting a lot of potential intervening variables.  The overtime aspect of the research is an interesting component, but I'm not convinced of the direct linkage between Republican governors and economic performance as a year-to-year match.  There is often a lag between policy decisions and economic performance so investigating this from a time-series perspective to account for any time lags seems more appropriate. ",
