    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Based on the specific data points (GDP, employment, etc), timeframe (10 years) and political party in charge it would appear that the conclusion is sound and justified.  I would suggest that the definition of the health of the economy should include some additional data points to further strengthen the findings.  It would seem that other factors such as the debt load, welfare roles, population make up, political make up of the Presidency and Congress as well as Federal budget influence on state economic performance be considered.  The definition of the health of these states economies may take on a different value if these additional data points are factored in. ",
