    "reviewContent": "This is an interesting premise. The data collected and utilized is considerable, and the manner that this data is correlated with the research hypothesis seems sound and feasible. My only critique would involve the role that many intangible factors might play on this analysis, such as wars, social upheaval or periods of calm, and the international climate/economy, all of which affected the country's overall economic health regardless of what party held the most governorships between 1948 and 2016. Perhaps considering assigning values to major events in this period and then plotting the results along with the current data to delineate if there is any change in results. ",
