    "id": 192,
    "mode": 0,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "The study appears sound, however I believe this study is worthless as it misses more important key factors.  Such things as the fact that governors do not play the only role in the economy.  The legislatures of those states would have more power in controlling that economy as well as the general economy of the nation.  There could be a relationship between few republican governors in total but that one state has one.  Therefore the economy of the nation could be bringing up the economy of that one state.  This is a very narrow study that doesn't provided anything of value to the educated reader.",
    "reviewRating": 1,
