    "reviewContent": "The conclusions reached by this data are entirely too limited in scope to be accepted. The conclusions are based on only one factor. Economics are complex. The economy is driven by world events, consumer volatility, etc. Republican governors are not all cut from the same cloth. Some are conservative, some moderate. Oversimplification of complex issues negate the validity of this conclusion.",
