    "reviewContent": "I see this article as providing correlation between the economy and Republican governors, but I think it is hasty in its conclusion. Governors mostly affect the states they govern, so using the whole US economy as a correlation is misleading. It would far more informative to evaluate individual states. It is a lot more work, but taking some states and evaluating each state's economy according to when it had a Democratic Governor vs a Republican Governor would tell you a lot more and possibly actually have a correlation.",
