    "reviewContent": "First, the economy is complex and cannot just be represented by one parameter such as economic performance. The authors looked at 3 other variables and because the trends didn't fit their narrative (e.g. stocks was a flat line and GDP showed a decreasing trend), they totally ignored it. I also think that just because there is a trend, doesn't mean that the Republicans are responsible for it. Kind of like a chicken or egg thing. There are other factors that can impact employment.",
