    "feedback": "This is an interesting topic. I would assume that republicans are more war happy, so economies tend to improve because there is more military investment and greater emphasis on industry and manufacturing.  However, with more manufacturing jobs leaving the US and the nation becoming more services-oriented in the last 20 years, I am sure the data would be would not be consistent.",
