    "reviewContent": "The conclusion is not supported by the data.  If GDP had been chosen as the representative of overall economic performance, then the opposite conclusion would have been reached.  There is no reason to choose employment statistics alone and to exclude GDP (and inflation and stocks) in the analysis.  Also, when the employment statistics were analyzed there should be information given about how the line was fit to the data points of the graph. What kind of formula was used to obtain the points to be used to create the line. There should also be standard deviation information given for each point that was used to create the line.",
