    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Data was collected across the governorships for the period 1918-2017 to assess whether the country fared better economically under Republican or Democratic governors. Information centered on four factors...employment, inflation, GDP and stock prices. The data was analyzed and combined to come up with an overall rating between 0 ad 1. Poor performance received a 0 rating.\nGood performance received a 1 rating. Average performance received a .5 rating and so forth. In the final analysis it was determined that the economy fared better under Republican governorship.",
