    "id": 154,
    "mode": 0,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Drawing conclusions from observational data is a big no-no. Don't do that. At best you can say you found a correlation and suggest means of testing that empirically.\n\nAlso, your data is garbage. Too much variation. That is to say, the difference between the highs and lows are much bigger than the change in the regression line. \n\nAlso, GDP is a garbage metric. It basically hands the government a mechanism for manipulating the perception of economic performance (just spend more to up G) and utterly fails to account for changes in retained wealth.\n\nAlso, stock prices are mostly just doubling up on inflation.\n\nThe correct conclusion is \"we're a bunch of useless fucking idiots and our adviser should be taken out and shot for his or her role in this paper.\"",
