    "id": 104,
    "mode": 0,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "Although I don't understand the statistics, I assume they are correct.  I would like you to answer why you didn't take date prior to 1948.  Is the data not available in all your categories?  Although your conclusion would make sense to me because of the spend and tax policies of Republicans for which I identify, Republicans are changing a lot.  Take the new health care bill as an example.  Republicans and Democrats change over the years.  Political party is not a consistent measure.  The current Republicans are much more apt to spend a lot and support big government and agencies, and not as apt to stick to their alleged core values.  Also, there are delays.  I see you measure each by year.  I think it would benefit us to see a line charted for each row individually.  ...Maybe delayed reactions would show up.  No government action has an immediate economic impact.  Also, national politics is a huge factor.  I like that you looked at many factors, but it's really not enough consideration.",
