    "reviewContent": "while I do not disagree with the metrics that were tracked to indicate economic success, I don't think enough other factors were considered about what could influence the economy. To go further, party dominance of state legislatures was not considered or tracked, nor was party controlled Congress or the presidency. Those are all major factors that contribute and shape economic development, and to ignore them is to ignore factors just as important as the governorship.",
