    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "I think the data shows some interesting correlations, however, I'm concerned that there are so many factors that are involved in employment and economic health, that some important variables have been left out.  I think there will need to be a discussion of whether or not the increase in employment during times with more republican governors is actually the result of policies that were put in place in the previous two, three, or four years when there were more Democrat governors.  I would like to see a more in depth analysis of that question.  Perhaps, you could limit your analysis to times when there were more republicans in office for more than three years in a row?",
