    "id": 238,
    "mode": 1,
    "identifiedError": false,
    "identifiedConclusion": false,
    "reviewContent": "This paper worked really well because the strong introduction to the paper and the data gave it a strong backbone to present its findings.  I really liked the idea of putting the data in a range from numbers between 0-1, it worked much better than using percentages.  The one problem that I have with this study is that the conclusion provides a very generic statement on why republican governments are better and only presents a strong correlation.  The use of the word strong in the conclusion shows a little bias, but I think it is borderline appropriate given that all 4 data points show trends for republican governemnts and against liberals.  I like how at the end of the conlcusion, this paper opens up the study for future research, and introspectively states that there is no specific reason for this being the case.",
