    "reviewContent": "The premise of the study makes sense in theory, but I do not believe you can come to a conclusion that Republicans in office equal a better economy, without taking into consideration the many other factors that may come into play. A lot of the times the economy is more affected by overall political climate, conflicts and wars, prosperity of overall American businesses, and the other politicians in office at the time. Only looking at governors does not lead to accurate data for the presumption. For instance. There could be more Republicans in local offices, while there being a Democratic majority overall in the federal offices. In that case wouldn't it mean that Democrats lead to a better economy. Overall, I did not think this study was done properly, nor were any other variables included in the study. ",
