    "id": 267,
    "mode": 1,
    "identifiedError": true,
    "identifiedConclusion": true,
    "reviewContent": "First of all, there is no indication as to how strong this correlation is. Where's the value on how significant a correlation it is? It doesn't appear extremely strong. Next, the researchers cherry-pick unemployment because it fits their hypothesis, but ignore GDP. Unemployment can be artificially low when the economy is bad, because many people give up on looking for jobs. Meanwhile, GDP suggests republicans rule in times of low GDP, not strong economic growth. Finally, the conclusion comes dangerously close to implying a causation. Perhaps people are less frugal in times of economic prosperity and more willing to vote for a party that will tax them more. There are too many factors here and only one dimension of the economy is explored. Where's data on wage growth? New home development? Many more data sets are needed to draw the conclusion this study reaches.",
    "reviewRating": 3,
